import React, { useEffect,useState } from "react";

function Products(){
    const [products,setProducts] = useState([])
    useEffect(  
    ()=>{fetch('https://fakestoreapi.com/products?limit=15')
            .then(res=>res.json())
            .then(json=>setProducts(json))}
    ,[])
    return(
        <div className="flex flex-wrap gap-5 justify-evenly h-full">
            <h1 className="text-center text-3xl underline">Categories</h1>
            {products.map((product)=>{
                console.log(product);
                return (<div className="bg-orange-400 h-10 text-center w-[75%] p-2 rounded-3xl text-xl m-auto">
                    {product.title}
                    </div>
                )})}
        </div>
)}

export default Products
